import React, {useState, useEffect}  from 'react';
import axios from 'axios';


export default function TelaList() {
  const [match, setMatch] = useState([])

  const GetMatches = () => {
    axios
      .get(
        "https://us-central1-missao-newton.cloudfunctions.net/astroMatch/nastia/matches",

      )
      .then(res => {
        // this.setState({ usersList: res.data });
       setMatch(res.data)
      })
      .catch(err => {
        console.log(err);
      })
  };
  return (
    <>
    <p>TelaList</p>
    </>
  )
}
